import React, { useMemo } from 'react';
import { DEALERS_COLUMN, STATES, DEALERS } from '../../assets/Json/data';
import { TableC } from '../../components/TableC/TableC';

const Distributor = () => {
  const columns = useMemo(() => DEALERS_COLUMN, []);
  const data = useMemo(() => DEALERS, []);
  return (
    <TableC
      columns={columns}
      searchTitle='Distributor'
      searchPlaceHolder='Search Distributor'
      dropdownList={STATES}
      data={data}
      heading="Dealer's List"
    />
  );
};

export default Distributor;
